+\n","  theme_void() +\n","  labs(title = \"Use of Smart Devices Distribution\")"]},{"cell_type":"markdown","id":"04a8973e","metadata":{"papermill":{"duration":0.021442,"end_time":"2023-08-17T02:47:59.368036","exception":false,"start_time":"2023-08-17T02:47:59.346594","status":"completed"},"tags":[]},"source":["The smart device usage by individuals were categorized into three; High use, Moderate use and Low use. From the analysis, we can see that:\n","\n","50% of the usesr fall into the High use category (which are users who use their device between 21 and 31 days).\n","\n","12% of the users fall into the Moderate use category (which are users who use their device between 11 and 19 days).\n","\n","38% of the users fall into the Low use category (which are users who use their device between 1 and 10 days).\n","\n","This shows that majority of the users make use of the smart device more often.\n","\n"]},{"cell_type":"markdown","id":"e143b65c","metadata":{"papermill":{"duration":0.021485,"end_time":"2023-08-17T02:47:59.410731","exception":false,"start_time":"2023-08-17T02:47:59.389246","status":"completed"},"tags":[]},"source":["## Act Phase\n","### Conclusion and Recommendation\n","\n","Important to acknowledge is the limited sample size and the absence of user demographic information in the utilized datasets, introducing potential bias.\n","\n","The analysis reveals a positive correlation between total steps and calories burned, though causation cannot be definitively established. Other factors like diet might contribute. Thus, urging users to enhance both walking and dietary habits is crucial. Bellabeat could introduce meal plans to aid effective diet management.\n","\n","Given users' heightened activity from 5pm to 7pm, notifications during this period could prompt increased engagement.\n","\n","Furthermore, Bellabeat has an opportunity to promote healthy sleep patterns by reminding users to prioritize adequate sleep.\n","\n"]}],"metadata":{"kernelspec":{"display_n